var baseWidth = 2110;
var baseHeight = 1500;
var zooms = {
    1: {
        width: 900,
        zoom: .41
    },
    2: {
        width: 1500,
        zoom: .71
    },
    3: {
        width: 2110,
        zoom: 1
    },
    4: {
        width: 2800,
        zoom: 1.32
    },
    5: {
        width: 3500,
        zoom: 1.65
    }
};
var currentZoom = 3;

function zoomIn() {
    currentZoom++;
    if (currentZoom > 5) currentZoom = 5;
    checkPlanets();
}

function zoomOut() {
    currentZoom--;
    if (currentZoom < 1) currentZoom = 1;
    checkPlanets();
}

function checkPlanets() {
    // $("#planets").draggable("destroy");

    if (window.innerWidth >= 768) {

        var fieldWidth = $('.wiki-map').width();

        // $('.wiki-map, .wiki-planets, .wiki-planet__link').css({'transition': '.3s all'});

        $('.wiki-map').css({
            'height': zooms[currentZoom].zoom * baseHeight
        });
        $('.wiki-planets').css({
            'left': (fieldWidth - zooms[currentZoom].zoom * baseWidth) / 2,
            'width': zooms[currentZoom].zoom * baseWidth,
            'height': zooms[currentZoom].zoom * baseHeight
        });
        $('.wiki-planet__link').css({
            'transform': 'scale(' + zooms[currentZoom].zoom + ')'
        });

        // setTimeout(function() {
        //     $('.wiki-map, .wiki-planets, .wiki-planet__link').css({'transition': 'none'});
        // }, 500);

        $("#planets").draggable({
            scroll: false
        });
    }
}

function is_match(what, where) {
    what = what.replace('(', '\\(');
    what = what.replace(')', '\\)');
    var re = new RegExp(what, "ig");
    return !(where.match(re) == null);
}

$(document).ready(function() {
    checkPlanets();

    $('[data-wiki-trigger]').on('click', function() {
        var content = $(this).data('wiki-trigger');
        var opts = {
            baseClass: 'wiki-fancybox',
            buttons: ["close"],
            btnTpl: {
                close: '<button data-fancybox-close class="wiki-fancybox-close"></button>',
                arrowLeft: '<button data-fancybox-prev class="wiki-fancybox-left"></button>',
                arrowRight: '<button data-fancybox-next class="wiki-fancybox-right"></button>'
            },
        };
        var arr = [];

        $('[data-wiki-content="' + content + '"]').each(function () {
            arr.push({
                src  : $(this).attr('src'),
                opts : opts
            });
        });

        $.fancybox.open(arr, {
            loop : true
        });

        // $.fancybox.open({
        //     selector: '[data-fancybox="wiki-content-1"]',
        //     type : 'image',
        //     opts : {
        //         afterShow : function( instance, current ) {
        //             console.info( 'done!' );
        //         }
        //     }
        // });
    });

    $(window).on('resize', function() {
        checkPlanets();
    });

    $('.wiki-plus').on('click', function() {
        zoomIn();
    });

    $('.wiki-minus').on('click', function() {
        zoomOut();
    });

    $('.wiki-search').on('click', function() {
        $('.wiki-popup').addClass('active');
    });

    $('[data-letter]').on('click', function(e) {
        e.preventDefault();
        var letter = $(this).data('letter');
        $('.wiki-popup__search input').val('');
        $('[data-letter]').removeClass('active');
        $(this).addClass('active');

        if (letter === 'all') {
            $('.wiki-popup__list a').show();
        } else {
            $('.wiki-popup__list a').each(function () {
                $(this).toggle($(this).text().trim().indexOf(letter) === 0);
            });
        }
    });

    $('.wiki-popup__search input').on('input', function() {
        var str = $(this).val().trim();
        $('[data-letter]').removeClass('active');
        if (str) {
            $('.wiki-popup__list a').each(function () {
                $(this).toggle(is_match(str, $(this).text().trim()));
            });
        } else {
            $('.wiki-popup__list a').show();
        }
    });

    $('.wiki-popup__close').on('click', function() {
        $('.wiki-popup').removeClass('active');
    });

});

$(document).ready(function() {

    var $showMore = $('.js-show-more-goods');
    var $items = $('.goods-item');

    function checkItems() {
        $showMore.toggleClass('hide', $items.filter('.hide:not(.filtered)').length === 0);
    }

    $showMore.on('click', function(e) {
        e.preventDefault();
        $items.filter('.hide:not(.filtered)').slice(0, 6).removeClass('hide');
        checkItems();
    });

    $('[data-goods-section]').on('click', function(e) {
        e.preventDefault();
        var section = $(this).data('goods-section');
        var sectionName = $(this).text().trim();
        $('[data-goods-section]').removeClass('active');
        $(this).addClass('active');

        if (section) {
            $('[data-good-section]').addClass('filtered');
            $('[data-good-section="' + section + '"]').removeClass('filtered');
        } else {
            $('[data-good-section]').removeClass('filtered');
        }

        $('.goods-tabs').removeClass('active');

        $('[data-dropdown-trigger]').text(sectionName);

        checkItems();
    });

    $('[data-dropdown-trigger]').on('click', function(e) {
        e.preventDefault();
        $('.goods-tabs').toggleClass('active');
    });

    checkItems();

});
